import './App.css';

function App() {
  const title = 'Welcome to the jungle';
  const likes = 50;
  const link = "http://www.google.com"

  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>Liked {likes} times</p>
        <p>{Math.random() * 10}</p>
      </div>
    </div>
  );
}

export default App;
